			var contentSource = [{name: "input.mp4", data}];
			var contentDuration = null;
			var contentParsing = null;

			var worker = new Worker("OnlineMP4Converter.js")
			worker.onmessage = function(e)
				{
				var msg = e.data;
				switch (msg.type)
					{
					case "ready":
					console.log("Ready.");
					break;

					case "stdout":
					case "stderr":
					if (contentDuration==null)
						{
						var myRegexp = /Duration: ([0-9][0-9]:[0-9][0-9]:[0-9][0-9]).*\/s/g;
						var match = myRegexp.exec(msg.data);
						if(match)
							{
							contentDuration = match[1];
							document.getElementById("duration").innerHTML = contentDuration;
							}
						}
						else
						{
						var myRegexp = /frame=.*time=([0-9][0-9]:[0-9][0-9]:[0-9][0-9]).*speed=/g;
						var match = myRegexp.exec(msg.data);
						if(match)
							{
							contentParsing = match[1];
							document.getElementById("parsing").innerHTML = contentParsing;
							}
						}

					if (contentDuration!=null && contentParsing!=null)
						{
						document.getElementById("progress").innerHTML = getPercentage(contentParsing,contentDuration) + "%";
						}
					break;

					case "exit":
					console.log("Process exited with code " + msg.data);
					break;

					case "done":
					console.log("Downloading...");
					saveVideo(new Blob([msg.data.MEMFS[0].data],{type:"video/mp4"}));
					break;
					}

			function getPercentage(timeone,timetwo)
				{
				return (100 * totalSeconds(timeone) / totalSeconds(timetwo)).toFixed(0);
				}

			function totalSeconds(time)
				{
				var parts = time.split(":");
				return parts[0] * 3600 + parts[1] * 60 + parts[2];
				}

			function saveVideo(blob)
				{
				var link = document.createElement("a");
				link.style.display = "none";
				document.body.appendChild(link);
				link.href = URL.createObjectURL(blob);
				link.download = "video.mp4";
				link.click();
				link.remove();
				}

			function base64ToBinary(dataURI)
				{
				var base64 = dataURI.replace(/^data[^,]+,/,"");
				var raw = window.atob(base64);
				var rawLength = raw.length;

				var array = new Uint8Array(new ArrayBuffer(rawLength));
				for (i = 0; i < rawLength; i++)
					{
					array[i] = raw.charCodeAt(i);
					}
				return array;
				}
